(2, 60, 'История', 'za-uchilishteto', '<p class=\"MsoNormal\"><span lang=\"EN-US\">           </span><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">Училището е открито на основание на Административен акт №1 от 02.01.1871г. като в началото се е помещавало в къщата до бряста, а по-късно в Господин Кючюковата къща. Училището отваря врати през учебната 1871/1872 година като начално училище (І-ІV отделение).</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">            На <b>17.10.1928 година </b>Училищното настоятелство взема решение за построяването на ново училище. Сградата е започнала да се строи на <b>15.08.1929 г.</b> и е завършена на <b>23.11.1929г.</b> Откриването е отпразнувано тържествено с много гости. На този ден е определено и името – Първоначално училище“Кольо Ганчев”, а на Педагогически съвет, проведен на <b>04.12.1929г., </b>е взето решение патронният празник да се чества на Никулден</span><span lang=\"RU\" style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: RU;\">.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: 45.35pt;\"><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">На <b>31.10.1958г.</b> е открита прогимназия с ученици от V и VІ клас, като учителите стават общо пет и един директор. През учебната <b>1959/1960г.</b> е открита ПДГ (Полудневна детска градина), а през <b>1964/1965г.</b> са открити две занимални в начална и прогимназиална степен. През годините учениците в училището се увеличават, паралелките стават двойни, групите в ПДГ са две. Увеличава се и преподавателският състав, назначен е и помощен персонал, директор и зам.директор, а също така лекар и медицински фелдшер.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-top: 6pt;\"><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">            На <b>15.09.1970г.</b> е построено ново крило на училището (учителска стая, кабинет по физика, кабинет по химия, физкултурен салон, зам.дирекция). Дворът  на училището е асфалтиран и базалтиран и е  оформена градина с розови храсти.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: 35.4pt;\"><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">На <b>15.09.1971г.</b> училището става напълно основно. За първа година е открита паралелка в осми клас с 46 ученици. Броят на учениците през учебната 1971/1972г. достига 578 от І до VІІІ клас и 65 деца в ПДГ в две групи. Този брой се запазва в общи лини до1991 година.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: 35.4pt;\"><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">На <b>31.12.1971г.</b> е построена нова сграда, в която се помещават работилници по металообработване, дървообработване и домакинство. Същите са обзаведени според последните изисквания за времето си.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: 35.45pt;\"><b><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">През 2002 година</span></b><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\"> бяха открити кабинети по музика</span> <span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">и  информатика с девет броя компютърни конфигурации, закупени от Община Стара Загора (5 броя), УН при училището (2 броя), а през 2003г. бяха подарени две компютърни конфигурации от Министерството на икономиката - София и закупен цветен принтер за нуждите на канцеларията. През годините остарялата компютърна база се обновява. Компютърният кабинет е оборудван с нови компютърни конфигурации, свързани в мрежа и с </span><span lang=\"EN-US\" style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black;\">Internet</span><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">, принтери, скенери и  мултимедиен апарат.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-top: 6pt;\"><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">През годините учениците от училището са участвали в множество състезания, конкурси, олимпиади, първенства. Спечелени са множество грамоти, награди и <b>купи по: </b>математика; БЕЛ (български език и литература); по хандбал, борба, футбол, тенис на маса и лека атлетика, от хора на училището; </span></p>\r\n<p class=\"MsoNormal\" style=\"margin-top: 6pt; text-indent: 35.4pt;\"><b><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">Една част от наградите са:</span></b></p>\r\n<p class=\"MsoNormal\" style=\"margin: 6pt 0cm 0.0001pt 35.4pt; text-indent: -20.4pt;\"><span style=\"font-family: Wingdings; mso-ascii-font-family: \'Comic Sans MS\'; mso-hansi-font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG; mso-char-type: symbol; mso-symbol-font-family: Wingdings;\">Ä</span><span style=\"font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">   </span><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">През учебната 1963/1964 година опитното поле на училището е  национален     първенец;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 6pt 0cm 0.0001pt 36pt; text-indent: -18pt;\"><span style=\"font-family: Wingdings; mso-ascii-font-family: \'Comic Sans MS\'; mso-hansi-font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG; mso-char-type: symbol; mso-symbol-font-family: Wingdings;\">Ä</span><span style=\"font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">  </span><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">През учебната 1964/1965 година футболният отбор на училището е вицешампион на страната с треньор Атанас Бенчев;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 6pt 0cm 0.0001pt 34.95pt; text-indent: -18pt;\"><!-- [if !supportLists]--><span style=\"mso-bidi-font-size: 11.0pt; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings; color: black; mso-ansi-language: BG;\">Ä<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span><!--[endif]--><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">През учебната 1965/1966 година футболният отбор на училището е на ІІІ място в страната с треньор Атанас Бенчев;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 6pt 0cm 0.0001pt 34.95pt; text-indent: -18pt;\"><!-- [if !supportLists]--><span style=\"mso-bidi-font-size: 11.0pt; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings; color: black; mso-ansi-language: BG;\">Ä<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span><!--[endif]--><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">През 1972г. с Указ №1055/19.05.1972г. на ДС на НРБ във връзка със 100 годишнината от създаването, училището е наградено с орден “Кирил и Методий” - І степен;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 6pt 0cm 0.0001pt 34.95pt; text-indent: -18pt;\"><!-- [if !supportLists]--><span style=\"mso-bidi-font-size: 11.0pt; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings; color: black; mso-ansi-language: BG;\">Ä<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span><!--[endif]--><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">През 1972г. със същия Указ директорът Господин Петков Кълвачев е награден с орден “Кирил и Методий” - ІІ степен;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 6pt 0cm 0.0001pt 34.95pt; text-indent: -18pt;\"><!-- [if !supportLists]--><span style=\"mso-bidi-font-size: 11.0pt; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings; color: black; mso-ansi-language: BG;\">Ä<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span><!--[endif]--><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">През 1972г. със същия Указ Катя Т.Гайдарова – пенсионерка, дългогодишна учителка в училището, е наградена с орден “Кирил и Методий” - ІІ степен;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 6pt 0cm 0.0001pt 34.95pt; text-indent: -18pt;\"><!-- [if !supportLists]--><span style=\"mso-bidi-font-size: 11.0pt; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings; color: black; mso-ansi-language: BG;\">Ä<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span><!--[endif]--><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">През 1973г. дългогодишната учителка по математика Стойка Минчева е наградена с орден“Кирил и Методий” - ІІІ степен по случай 24-ти май;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 6pt 0cm 0.0001pt 34.95pt; text-indent: -18pt;\"><!-- [if !supportLists]--><span style=\"mso-bidi-font-size: 11.0pt; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings; color: black; mso-ansi-language: BG;\">Ä<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span><!--[endif]--><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">Хорът на училището с ръководител Мария Сергеева – учител по музика заема ІІ място през 1988г. на общинския преглед на училищните хорове гр.Стара Загора;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 6pt 0cm 0.0001pt 34.95pt; text-indent: -18pt;\"><!-- [if !supportLists]--><span style=\"mso-bidi-font-size: 11.0pt; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings; color: black; mso-ansi-language: BG;\">Ä<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span><!--[endif]--><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">На 03.06.1999г. в с.Долни Лозен, Софийско отборът по първа помощ при училището с ръководител мед.фелдшер Маргарита Ярославова се класира на ІV място на ХХ-то юбилейно национално състезание по първа помощ, организирано от БМЧК;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 6pt 0cm 0.0001pt 34.95pt; text-indent: -18pt;\"><!-- [if !supportLists]--><span style=\"mso-bidi-font-size: 11.0pt; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings; color: black; mso-ansi-language: BG;\">Ä<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span><!--[endif]--><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">През 2001г. ученикът от ІV клас Димитър Николаев Митев е награден със златен медал и обявен за математик на годината от в-к “Математическа поща”;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 6pt 0cm 0.0001pt 34.95pt; text-indent: -18pt;\"><!-- [if !supportLists]--><span style=\"mso-bidi-font-size: 11.0pt; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings; color: black; mso-ansi-language: BG;\">Ä<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span><!--[endif]--><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">За 24 май 2002г. директорът инж.Иван Марков Колаксъзов е награден с грамота за високи организационни и управленски умения от Кмета на Община Стара Загора д-р Евгений Желев;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 6pt 0cm 0.0001pt 34.95pt; text-indent: -18pt;\"><!-- [if !supportLists]--><span style=\"mso-bidi-font-size: 11.0pt; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings; color: black; mso-ansi-language: BG;\">Ä<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span><!--[endif]--><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">През 2005г. отборът по тенис на маса-момичета с ръководител Милко Цонев – учител по физическа култура и спорт се класира на ІІ място на общинските ученически игри и получава  купа;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 6pt 0cm 0.0001pt 34.95pt; text-indent: -18pt;\"><!-- [if !supportLists]--><span style=\"mso-bidi-font-size: 11.0pt; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings; color: black; mso-ansi-language: BG;\">Ä<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span><!--[endif]--><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\"> През 2005г. отборът по лека атлетика-момчета с ръководител Милко Цонев – учител по физическа култура и спорт се класира на ІІ място на общинските ученически игри и получи купа;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 6pt 0cm 0.0001pt 34.95pt; text-indent: -18pt;\"><!-- [if !supportLists]--><span style=\"mso-bidi-font-size: 11.0pt; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings; color: black; mso-ansi-language: BG;\">Ä<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span><!--[endif]--><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">   <u>ОБЛАСТНИ СЪСТЕЗАНИЯ 2006:</u></span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 6pt 0cm 0.0001pt 74.1pt;\"><span style=\"font-size: 11.0pt; font-family: \'Wingdings 2\'; mso-ascii-font-family: \'Comic Sans MS\'; mso-hansi-font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG; mso-char-type: symbol; mso-symbol-font-family: \'Wingdings 2\';\">·</span><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">         лека атлетика (момичета V-VІІ клас)            - І място</span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 6pt 0cm 0.0001pt 74.1pt;\"><span style=\"font-size: 11.0pt; font-family: \'Wingdings 2\'; mso-ascii-font-family: \'Comic Sans MS\'; mso-hansi-font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG; mso-char-type: symbol; mso-symbol-font-family: \'Wingdings 2\';\">·</span><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">        тенис на маса (момичета V-VІІ клас)             - І място</span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 6pt 0cm 0.0001pt 45pt; text-indent: -27pt;\"><span style=\"font-family: Wingdings; mso-ascii-font-family: \'Comic Sans MS\'; mso-hansi-font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG; mso-char-type: symbol; mso-symbol-font-family: Wingdings;\">Ä</span><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">      <u>ЗОНАЛНИ СЪСТЕЗАНИЯ 2006:      </u></span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 6pt 0cm 0.0001pt 74.1pt;\"><span style=\"font-size: 11.0pt; font-family: \'Wingdings 2\'; mso-ascii-font-family: \'Comic Sans MS\'; mso-hansi-font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG; mso-char-type: symbol; mso-symbol-font-family: \'Wingdings 2\';\">°</span><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">       лека атлетика (момичета V-VІІ клас)             - ІІ място <i>( гр.Стара         Загора)</i></span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 6pt 0cm 0.0001pt 74.1pt;\"><span style=\"font-size: 11.0pt; font-family: \'Wingdings 2\'; mso-ascii-font-family: \'Comic Sans MS\'; mso-hansi-font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG; mso-char-type: symbol; mso-symbol-font-family: \'Wingdings 2\';\">°</span><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">       тенис на маса (момичета V-VІІ клас)             - ІІ място <i>( гр.Ардино)</i></span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 6pt 0cm 0.0001pt 36pt; text-indent: -18pt;\"><!-- [if !supportLists]--><span style=\"mso-bidi-font-size: 11.0pt; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings; color: black; mso-ansi-language: BG;\">Ä<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span><!--[endif]--><u><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">НАЦИОНАЛНА УЧЕНИЧЕСКА СПОРТНА ОЛИМПИАДА “ГЛОБУЛ СТАРТ`2006”</span></u><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\"> – І място отборно; индивидуално – 2 златни, 1 сребърен и 1 бронзов медали и награда аудиосистема “</span><span lang=\"EN-US\" style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black;\">Sanyo</span><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">”  за нуждите на учителя по физическа култура и спорт и класиране на 3-ма участници на финалите в гр.София.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 35.4pt; text-indent: 18.6pt;\"><span lang=\"RU\" style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: RU;\">Училището е обърнато към предизвикателствата на ХХІ век. Глобализацията на човешкото познание и култура има своите непосредствени реализации в училището. В него са създадени отлични условия за обучение на учениците, което увеличава шансовете им за оптимална реализация. Авторитетът на училището се поддържа  от приемствеността между няколкото поколения директори, учители и възпитаници на училището, което е гаранция за истински осъзнати стойности в образованието и овладяването на европейската култура.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-top: 6pt;\"><b><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">Директори на училището през годините са били:</span></b></p>\r\n<p class=\"MsoNormal\" style=\"margin: 6pt 0cm 0.0001pt 45pt; text-indent: -27pt;\"><!-- [if !supportLists]--><span style=\"font-size: 11.0pt; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings; color: black; mso-ansi-language: BG;\">¤<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">   </span></span><!--[endif]--><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">Катя Т. Гайдарова - първият директор на училището, от учебната 1955/1956г. до учебната 1957/1958г.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 6pt 0cm 0.0001pt 72pt; text-indent: -54pt;\"><!-- [if !supportLists]--><span style=\"font-size: 11.0pt; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings; color: black; mso-ansi-language: BG;\">¤<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">   </span></span><!--[endif]--><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">Димитър Илиев Славчев – през учебната 1958/1959г.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 6pt 0cm 0.0001pt 72pt; text-indent: -54pt;\"><!-- [if !supportLists]--><span style=\"font-size: 11.0pt; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings; color: black; mso-ansi-language: BG;\">¤<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">   </span></span><!--[endif]--><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">Господин Петков Кълвачев – от учебна 1959/1960г. до учебната 1987/1988г.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 6pt 0cm 0.0001pt 72pt; text-indent: -54pt;\"><!-- [if !supportLists]--><span style=\"font-size: 11.0pt; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings; color: black; mso-ansi-language: BG;\">¤<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">   </span></span><!--[endif]--><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">Атанас Костов Димитров – от учебна 1988/1989г. до учебна 1989/1990г.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 6pt 0cm 0.0001pt 72pt; text-indent: -54pt;\"><!-- [if !supportLists]--><span style=\"font-size: 11.0pt; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings; color: black; mso-ansi-language: BG;\">¤<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">   </span></span><!--[endif]--><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">Ганка Костова Георгиева - от учебна 1990/1991г. до учебна 1991/1992г.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 6pt 0cm 0.0001pt 72pt; text-indent: -54pt;\"><!-- [if !supportLists]--><span style=\"font-size: 11.0pt; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings; color: black; mso-ansi-language: BG;\">¤<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">   </span></span><!--[endif]--><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">Иван Георгиев Димов, Вр.ИДД (Временно изпълняващ длъжността директор) през учебната 1992/1993г.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 6pt 0cm 0.0001pt 72pt; text-indent: -54pt;\"><!-- [if !supportLists]--><span style=\"font-size: 11.0pt; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings; color: black; mso-ansi-language: BG;\">¤<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">   </span></span><!--[endif]--><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">Румяна Маркова Койчева, ВрИДД през учебната 1993/1994г.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 6pt 0cm 0.0001pt 72pt; text-indent: -54pt;\"><!-- [if !supportLists]--><span style=\"font-size: 11.0pt; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings; color: black; mso-ansi-language: BG;\">¤<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">   </span></span><!--[endif]--><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">Милка Димитрова Иванова, ВрИДД през учебната 1994/1995г.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 6pt 0cm 0.0001pt 72pt; text-indent: -54pt;\"><!-- [if !supportLists]--><span style=\"font-size: 11.0pt; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings; color: black; mso-ansi-language: BG;\">¤<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">   </span></span><!--[endif]--><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">Марио Минев Цветков, ВрИДД през учебната 1995/1996г. </span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 6pt 0cm 0.0001pt 72pt; text-indent: -54pt;\"><!-- [if !supportLists]--><span style=\"font-size: 11.0pt; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings; color: black; mso-ansi-language: BG;\">¤<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">   </span></span><!--[endif]--><span style=\"font-size: 11.0pt; font-family: \'Comic Sans MS\'; mso-bidi-font-family: Arial; color: black; mso-ansi-language: BG;\">Галя Петрова Узунова,ВрИДД от учебната 1996/1997г. до учебната 1997/1998г.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 6pt 0cm 0.0001pt 72pt; text-indent: -54pt;\"><!-- [if !supportLists]--><span style=\"font-size: 11.0pt; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings; color: black; mso-ansi-language: BG;\">¤<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">   </span></span><!--[endif]--><span style=\"font-size: 11.0pt; font-