(5, 63, 'Правилници и планове', 'pravilnitzi', '<p> <a href=\"docs/2023/noemvri2023/Годишен план на училището.pdf\" target=\"_blank\" rel=\"noopener noreferrer\">ГОДИШЕН ПЛАН НА ОСНОВНО УЧИЛИЩЕ ”КОЛЬО ГАНЧЕВ” ГР. СТАРА ЗАГОРА ЗА УЧЕБНАТА 2023/2024 ГОДИНА</a></p>\r\n<p><a href=\"docs/2023/noemvri2023/План за осъществяване на стратегията.pdf\" target=\"_blank\" rel=\"noopener noreferrer\">План на дейностите за реализиране на целите, задачите и приоритетите</a></p>\r\n<p><a href=\"docs/2023/noemvri2023/Правилник за вътр. трудов ред.pdf\" target=\"_blank\" rel=\"noopener noreferrer\">Правилник за вътрешния трудов ред</a></p>\r\n<p><a href=\"docs/2023/noemvri2023/Правилник за устройство и дейността.pdf\" target=\"_blank\" rel=\"noopener noreferrer\">Правилник за устройство и дейността на Основно Училище \"Кольо Ганчев\"</a></p>\r\n<p><a href=\"docs/2023/noemvri2023/Форми на обучение.pdf\" target=\"_blank\" rel=\"noopener noreferrer\">ФОРМИ НА ОБУЧЕНИЕ В ОСНОВНО УЧИЛИЩЕ „КОЛЬО ГАНЧЕВ” за учебната 2023-2024 година</a></p>\r\n<p> </p>\r\n<p><a href=\"docs/2024/Годишен план на ОУ Кольо Ганчев, гр Стара Загора за учебната 2024-2025 година.pdf\" target=\"_blank\" rel=\"noopener noreferrer\">ГОДИШЕН ПЛАН НА ОСНОВНО УЧИЛИЩЕ ”КОЛЬО ГАНЧЕВ” ГР. СТАРА ЗАГОРА ЗА УЧЕБНАТА 2024/2025 ГОДИНА</a></p>\r\n<p><a href=\"docs/2024/План за защита при бедствия.pdf\" target=\"_blank\" rel=\"noopener noreferrer\">План за защита при бедствия</a></p>\r\n<p><a href=\"docs/2024/План за квалификационната дейност.pdf\" target=\"_blank\" rel=\"noopener noreferrer\">План за квалификационната дейност</a></p>\r\n<p><a href=\"docs/2024/Правилник за устройство и дейността на основно училище Кольо Ганчев.pdf\" target=\"_blank\" rel=\"noopener noreferrer\">Правилник за устройство и дейността на Основно училище \"Кольо Ганчев\"</a><a href=\"docs/2024/План за квалификационната дейност.pdf\" target=\"_blank\" rel=\"noopener noreferrer\"><br /></a></p>\r\n<p><a href=\"docs/2024/Форми на обучение в основно училище Кольо Ганчев.pdf\" target=\"_blank\" rel=\"noopener noreferrer\">Форми на обучение в Основно училище \"Кольо Ганчев\" за учебната 2024-2025 година</a></p>\r\n<p><a href=\"docs/2023/Стратегия за развитие на училището.pdf\" target=\"_blank\" rel=\"noopener noreferrer\">Стратегия за развитие на училището</a></p>\r\n<p><a href=\"docs/2025/Графици, разписание и ууп/Планове/Стратегия за развитие на училището.pdf\">Стратегия за развитие на училището</a></p>\r\n<p><a href=\"docs/2025/Графици, разписание и ууп/Планове/Правилник за вътрешния трудов ред.pdf\">Правилник за вътрешния трудов ред</a></p>\r\n<p><a href=\"docs/2025/Графици, разписание и ууп/Планове/Програма ЗА ПРЕВЕНЦИЯ НА ОТПАДАНЕТО НА УЧЕНИЦИ.pdf\">Програма за превенция на отпадането на ученици</a></p>\r\n<p><a href=\"docs/2025/Графици, разписание и ууп/Планове/План и програма.pdf\">План и свързаната с него програма за дейностите по безопасност на движението по пътищата</a></p>\r\n<p><a href=\"docs/2025/Графици, разписание и ууп/Планове/План за превенция от отпадане от училище.pdf\">План за превенция от отпадане от училище</a></p>\r\n<p><a href=\"docs/2025/Графици, разписание и ууп/Планове/ПЛАН ЗА ИЗПЪЛНЕНИЕ НА ДЕЙНОСТИТЕ.pdf\">План за изпълнение на дейностите по стратегията за развитие</a></p>\r\n<p><a href=\"docs/2025/Графици, разписание и ууп/Планове/КАЛЕНДАРЕН ПЛАН НА ДЕЙНОСТИТЕ за изпълнение на основните задачи.pdf\">Календарен план на дейностите за изпълнение на основните задачи</a></p>\r\n<p> </p>', '', 1, 8, '2016-11-09 20:09:44', 919, '', '2025-04-08 09:46:52', 919, 0, '0000-00-00 00:00:00', '2016-11-09 20:09:44', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 57, 7, '', '', 1, 5129, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', '');
INSERT INTO `josme_content` (`id`, `asset_id`, `title`, `alias`, `introtext`, `fulltext`, `state`, `catid`, `created`, `created_by`, `created_by_alias`, `modified`, `modified_by`, `checked_out`, `checked_out_time`, `publish_up`, `publish_down`, `images`, `urls`, `attribs`, `version`, `ordering`, `metakey`, `metadesc`, `access`, `hits`, `metadata`, `featured`, `language`, `xreference`, `note`) VALUES
(6, 64, 'Добре дошли', 'dobre-doshli', '<p style=\"text-align: center;\"><span style=\"font-size: 18pt;\"> </span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 18pt;\"><a href=\"docs/2025/График прием/Заповед график прием 2025-2026.docx\" target=\"_blank\" rel=\"noopener noreferrer\">Заповед график прием 2025-2026</a></span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 18pt;\"><a href=\"docs/2024/график за дейностите по прим в първи клас за 2024 година , утвърден от кмета на Община Стара Загора.pdf\" target=\"_blank\" rel=\"noopener noreferrer\"><br />Прием на ученици </a></span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 18pt;\"><a href=\"docs/2024/график за дейностите по прим в първи клас за 2024 година , утвърден от кмета на Община Стара Загора.pdf\" target=\"_blank\" rel=\"noopener noreferrer\">График на дейностите за прием в I клас</a></span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 18pt;\"><a href=\"docs/2025/Графици, разписание и ууп/Планове/заповед утв на прием.pdf\">Заповед за утвърждаване на Училищен план-прием за ученици в І и V клас на учебната 2025/2026 г.</a> </span></p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 18pt;\"><a href=\"docs/2025/Финансова грамотност 2024 2025г/Резултати/приложение.pdf\" target=\"_blank\" rel=\"alternate noopener noreferrer\">Протокол с резултатите от областен кръг на Национално състезание по Финансова грамотност 2024/2025г.</a></span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 18pt;\"><a href=\"index.php?option=com_content&amp;view=article&amp;id=22&amp;catid=2\">Национално състезание по финансова грамотност през учебната 2024/2025г. Областен кръг</a></span></p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>\r\n<p><video style=\"margin: 0px;\" src=\"images/ekip/prezentaciq.mp4\" preload=\"none\" autoplay=\"autoplay\" loop=\"loop\" muted=\"muted\" controls=\"controls\" width=\"800\" height=\"400\"></video></p>\r\n<p><img class=\"pull-left\" style=\"border-width: 5px; margin: 5px 15px 5px 15px;\" src=\"images/begin.jpg\" width=\"300\" height=\"225\" />     <img src=\"data:image/jpeg;base64,\" width=\"189\" height=\"252\" />   </p>\r\n<p><span style=\"color: #433b32; text-align: left; background-color: rgba(240, 237, 235, 0.498039);\">Добре дошли в официалният сайт на Основно училище \"Кольо Ганчев\" гр. Стара Загора. Тук ще узнаете за основаването и развитието на нашето училище през годините и ще получите информация за неговият патрон. Ще се запознаете със съвременното състояние на Основно училище \"Кольо Ганчев\", екипът, който работи в училище (ръководство, учители). На уебсайта са поместени отчетите за изпълнение на бюджета на училището, седмичното разписание на учебните часове, информация за устройството, организацията и дейността на обществения съвет към ОУ \"Кольо Ганчев\". Ще се запознаете с проектите, в които участва училището и работата по тях. Галерията от снимки ще ви представят изявите на нашите ученици. Можете да се свържете с нас чрез </span><a style=\"color: #8c7c69; background-color: rgba(240, 237, 235, 0.498039);\" title=\"Форма за контакт\" href=\"index.php/kontakti\" rel=\"alternate\">формата за контакт</a><span style=\"color: #433b32; text-align: left; background-color: rgba(240, 237, 235, 0.498039);\"> и да разгледате сайта на училището. Желаем Ви приятни и полезни изживявания в нашия сайт!</span></p>', '', 1, 9, '2020-05-22 07:38:54', 919, '', '2025-06-27 17:49:34', 919, 919, '2025-09-20 09:53:07', '2020-05-22 07:38:54', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"0\",\"show_modify_date\":\"0\",\"show_publish_date\":\"0\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 47, 1, '', '', 1, 66987, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 1, '*', '', '');
INSERT INTO `josme_content` (`id`, `asset_id`, `title`, `alias`, `introtext`, `fulltext`, `state`, `catid`, `created`, `created_by`, `created_by_alias`, `modified`, `modified_by`, `checked_out`, `checked_out_time`, `publish_up`, `publish_down`, `images`, `urls`, `attribs`, `version`, `ordering`, `metakey`, `metadesc`, `access`, `hits`, `metadata`, `featured`, `language`, `xreference`, `note`) VALUES
(7, 75, 'Нашият патрон', 'nashiyat-patron', '<p><img class=\"pull-left\" style=\"border-width: 5px; margin: 8px 15px 8px 15px;\" title=\"Кольо Ганчев\" src=\"images/kg.jpg\" alt=\"Снимка на Кольо Ганчев\" width=\"200\" height=\"266\" /></p>\r\n<p>   Героите не умират, докато има кой да ги помни.</p>\r\n<p>   Това е историята на един смел,горд и безстрашен родолюбец . Саможертва, направена от човек в името на една по-висша идея. СВОБОДАТА!</p>\r\n<p>   Българин, избрал да заплати със смъртта си в името на една свободна Майка България. Герой , за който ние трябва да разказваме и помним, защото - героите не умират, докато има кой да ги помни.</p>\r\n<p>   Никола Ганчев е роден на 5 февруари 1843 г. в с. Муратлии, Старозагорско. По професия е обущар.</p>\r\n<p>   Съратник на Васил Левски. Председател на Старозагорския частен революционен комитет революционния комитет, основан от <a href=\"https://bg.wikipedia.org/wiki/%D0%92%D0%B0%D1%81%D0%B8%D0%BB_%D0%9B%D0%B5%D0%B2%D1%81%D0%BA%D0%B8\">Васил Левски</a>.</p>\r\n<p>  Организатор и участник в <a href=\"https://bg.wikipedia.org/wiki/%D0%A1%D1%82%D0%B0%D1%80%D0%BE%D0%B7%D0%B0%D0%B3%D0%BE%D1%80%D1%81%D0%BA%D0%BE_%D0%B2%D1%8A%D1%81%D1%82%D0%B0%D0%BD%D0%B8%D0%B5\">Старозагорското въстание (1875)</a>, заедно с братята <a href=\"https://bg.wikipedia.org/wiki/%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%96%D0%B5%D0%BA%D0%BE%D0%B2\">Михаил</a> и <a href=\"https://bg.wikipedia.org/wiki/%D0%93%D0%B5%D0%BE%D1%80%D0%B3%D0%B8_%D0%96%D0%B5%D0%BA%D0%BE%D0%B2_(%D1%80%D0%B5%D0%B2%D0%BE%D0%BB%D1%8E%D1%86%D0%B8%D0%BE%D0%BD%D0%B5%D1%80)\">Георги Жекови</a>,<a href=\"https://bg.wikipedia.org/wiki/%D0%A1%D1%82%D0%B5%D1%84%D0%B0%D0%BD_%D0%A1%D1%82%D0%B0%D0%BC%D0%B1%D0%BE%D0%BB%D0%BE%D0%B2\">Стефан Стамболов</a>, Господин Михайловски, Стефан Чифудов, Руси Аргов, Никола Райнов-Пантата и много други.         Заловен е през септември 1875 г. и изтезаван в продължение на няколко месеца. Обесен е в Стара Загора на градския площад пред очите на съгражданите си.</p>\r\n<p>   Днес в Стара Загора в негова чест са именувани <a href=\"https://bg.wikipedia.org/wiki/%D0%9A%D0%BE%D0%BB%D1%8E_%D0%93%D0%B0%D0%BD%D1%87%D0%B5%D0%B2_(%D0%BA%D0%B2%D0%B0%D1%80%D1%82%D0%B0%D0%BB_%D0%BD%D0%B0_%D0%A1%D1%82%D0%B0%D1%80%D0%B0_%D0%97%D0%B0%D0%B3%D0%BE%D1%80%D0%B0)\">квартал</a> и улица. Построен е паметник в центъра на града.<a href=\"https://bg.wikipedia.org/wiki/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0_%D0%93%D0%B0%D0%BD%D1%87%D0%B5%D0%B2#cite_note-1\"><sup>[1]</sup></a></p>\r\n<p>  Кольо Ганчев е личността която Стара Загора трябва да помни, почита и разказва. Роден на 5 февруари 1843г . в Стара Загора. Високообразована личност водена от една единствена цел-свободата на своя народ.</p>\r\n<p>  Пръв приятел на Апостола Левски,съратник на Любен Каравелов и Христо Ботев. Не случайно Апостола му възлага да ръководи комитет в голям и стратегически град като Стара Загора. Той е и председател на Старозагорския революционен комитет от самото начало през август 1869г. Изключителните качества на Кольо Ганчев като лидер и организатор на старозагорските националисти скоро дават и плод – комитета става един от най-големите действащи звена със членска маса над 100 души.</p>\r\n<p>   В борбата да види България свободна той жертва себе си и бива обесен едва на 33 г. възраст. Дори тогава, когато поглежда смъртта в очите показва истинска сила, смелост и безстрашие. Поемайки отговорността за бунта върху себе си без да предаде нито едно име въпреки жестоките мъчения в ареста заявява пред следствената комисия : \"Моята цел и желание бяха да развея българското знаме върху турския конак и да видя Отечеството си свободно!“</p>\r\n<p> </p>', '', 1, 9, '2016-11-12 19:57:57', 919, '', '2016-11-26 09:57:01', 919, 919, '2020-10-12 08:05:39', '2016-11-12 19:57:57', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 13, 5, '', '', 1, 5325, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
