(19, 99, 'Ред и условия за продължаване на обучението', '2021-11-23-08-18-45', '<p><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\"><b>РЕД И УСЛОВИЯ ЗА ПРОДЪЛЖАВАНЕ НА ОБУЧЕНИЕТО ЗА ЛИЦА, КОИТО НЕ СА ПОСЕЩАВАЛИ УЧИЛИЩЕ ИЛИ СА ПРЕКЪСНАЛИ ОБУЧЕНИЕТО СИ ПРЕЗ МИНАЛИ ГОДИНИ В ОБРАЗОВАТЕЛНАТА СИСТЕМА</b></span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\">1. В самостоятелна форма може да се обучават лица, навършили 16 години.</span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\">2. Самостоятелната форма включва самостоятелна подготовка и изпити за определяне на годишни оценки по учебните предмети от училищния учебен план.</span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\">3. При самостоятелна форма на обучение се прилага утвърден училищен учебен план за дневна форма на обучение. </span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\">4. Учебното време за самостоятелната форма се организира от училището чрез изпити и от ученика, който се подготвя самостоятелно за тях.</span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\">5. За записване в самостоятелна форма на обучение се подава  заявление (по образец) до директора на училището преди началото на учебната година.</span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\">6. Заявлението за записване в самостоятелна форма на обучение може да се подаде и до 20 учебни дни преди изпитна сесия, определена в правилника за дейността на училището.</span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\">7. Към заявлението за записване се прилагат следните документи:</span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\"><b>За начален и прогимназиален етап: </b></span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\">- Удостоверение за последния завършен клас – оригинал. </span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\">- ако лицето не е посещавало никога училище се попълва декларация за това.</span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\"><b>За гимназиален етап:</b></span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\">- Свидетелство за завършено основно образование – копие и оригинал за сверяване – за записване в първия от класовете на гимназиален етап; </span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\">- Удостоверение за последния завършен клас – оригинал. За записване в гимназиален етап е необходим и училищен учебен план, по който лицето се е обучавало, преди да прекъсне обучението си. При различия в учебния план се полагат  приравнителни изпити.</span></span></p>\r\n<p align=\"JUSTIFY\"><a name=\"_GoBack\"></a> <span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\">8. При подаване на заявлението се представя и документ за самоличност (лична карта). </span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\">9. За записване на ученика в самостоятелна форма на обучение директорът на училището издава заповед.</span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\">10. Изпитите по учебните предмети от училищния учебен план са организирани в сесии, чийто брой през учебната година се определя в правилника за дейността на училището.</span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\">11. За лицата навършили 16 години се допуска обучение за завършване на два класа в една година, ако са заявили това свое желание при подаване на заявлението за записване в самостоятелна форма на обучение. Те полагат изпити за следващ клас само </span></span>ако успешно са положили всички изпити, предвидени за завършване на предходния клас.</p>', '', 1, 8, '2021-11-23 08:18:45', 919, '', '2021-11-23 08:18:45', 0, 0, '0000-00-00 00:00:00', '2021-11-23 08:18:45', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 1, 3, '', '', 1, 4336, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(20, 100, 'Въпроси и отговори', '2021-11-23-08-21-15', '<p align=\"CENTER\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\"><b>ВЪПРОСИ И ОТГОВОРИ</b></span></span></p>\r\n<p align=\"CENTER\"> </p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\"><b>Въпрос</b>: Искам да продължа образованието си в самостоятелна форма на обучение, но не знам какви ограничения съществуват. </span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\"><b>Отговор</b>: Всеки има право на образование и може да повишава образованието и квалификацията си чрез учене през целия живот. В самостоятелна форма на обучение могат да се обучават лица, навършили 16 годишна възраст. </span></span></p>\r\n<p align=\"JUSTIFY\"> </p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\"><b>Въпрос</b>: Как мога да се запиша в самостоятелна форма на обучение?</span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\"><b>Отговор</b>: За записване в самостоятелна форма на обучение се подава заявление (по образец) до директора на училището преди началото на учебната година. Заявлението за записване в самостоятелна форма на обучение може да се подаде и до 20 учебни дни преди изпитна сесия, определена в правилника за дейността на училището.</span></span></p>\r\n<p align=\"JUSTIFY\"> </p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\"><b>Въпрос:</b> Какви документи са необходими за записване в самостоятелна форма на обучение:</span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\"><b>Отговор: </b></span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\"><i>За начален и прогимназиален етап: </i></span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\">- Удостоверение за последния завършен клас – оригинал. </span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\">- ако лицето не е посещавало никога училище се попълва декларация за това.</span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\"><i>За гимназиален етап:</i></span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\">- Свидетелство за завършено основно образование – копие и оригинал за сверяване – за записване в първия от класовете на гимназиален етап; </span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\">- Удостоверение за последния завършен клас – оригинал. За записване в гимназиален етап е необходим и училищен учебен план, по който лицето се е обучавало, преди да прекъсне обучението си. При различия в учебния план се полагат  приравнителни изпити.</span></span></p>\r\n<p align=\"JUSTIFY\"> </p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\"><b>Въпрос</b>: Мога ли да придобия основно образование?</span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\"><b>Отговор</b>: Обучението за придобиване на основно образование се осъществява от I до VII клас включително в два етапа, както следва:</span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\">1. начален - от I до IV клас включително, и</span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\">2. прогимназиален - от V до VII клас включително.</span></span></p>\r\n<p align=\"JUSTIFY\"> </p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\"><b>Въпрос</b>: Мога ли да придобия средно образование?</span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\"><b>Отговор:</b> Обучението за придобиване на средно образование се осъществява от VIII до XII клас включително в два етапа, както следва:</span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\">1. първи гимназиален - от VIII до Х клас включително, и</span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\">2. втори гимназиален - от ХI до ХII клас включително.</span></span></p>\r\n<p align=\"JUSTIFY\"> </p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\"><b>Въпрос</b>: Мога ли за завърша два класа за една учебна година?</span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\"><b>Отговор</b>: За лицата, навършили 16 годишна възраст и записани в самостоятелна форма на обучение се допуска обучение за завършване на два класа в една година, ако са заявили това свое желание при подаване на заявлението за записване.  Те полагат изпити за следващ клас само ако успешно са положили всички изпити, предвидени за завършване на предходния клас.</span></span></p>\r\n<p align=\"JUSTIFY\"> </p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\"><b>Въпрос: </b>Как се осъществява самостоятелната форма на обучение?</span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\"><b>Отговор: </b>Самостоятелната форма включва самостоятелна подготовка и изпити за определяне на годишни оценки по учебните предмети от училищния учебен план. Изпити за определяне на годишна оценка по учебен предмет или модул се полагат присъствено в училище от учениците, обучавани в самостоятелна форма на обучение. Изпитът за определяне на годишна оценка се полага върху учебното съдържание, включено в учебната програма по съответния учебен предмет или модул за съответния клас и за съответния вид подготовка.</span></span></p>\r\n<p align=\"JUSTIFY\"> </p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\"><b>Въпрос</b>: Кога се провеждат изпитите за ученици в самостоятелна форма на обучение?</span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\"><b>Отговор:</b> изпитите по учебните предмети от училищния учебен план са организирани в 3 сесии – една редовна и две поправителни, съгласно Правилника за дейността на училището.</span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\"><b>Въпрос</b>: По какъв учебен план ще се обучавам?</span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\"><b>Отговор:</b> При самостоятелна форма на обучение се прилага училищният учебен план за дневна форма на обучение.</span></span></p>\r\n<p align=\"JUSTIFY\"> </p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\"><b>Въпрос</b>: Ако повтарям учебната година ще се явявам ли на изпити по всички предмети?</span></span></p>\r\n<p align=\"JUSTIFY\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: medium;\"><b>Отговор</b>: Ученик, който е в самостоятелна форма, при повтаряне на класа се явява на изпити само по учебните предмети или модули, по които има оценка \"слаб (2)\".</span></span></p>', '', 1, 2, '2021-11-23 08:21:15', 919, '', '2021-11-23 08:21:15', 0, 0, '0000-00-00 00:00:00', '2021-11-23 08:21:15', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 1, 1, '', '', 1, 4297, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', '');
